INSERT INTO `contanotascont` VALUES (1,5,'SITFIN','1','Efectivo y equivalente a efectivo incluye los valores caja, bancos y otros depósitos, además los valores de las cuentas fuera del país que se encuentran en dólares y fueron valorizadas con la TRM del 30 de Mayo según lo dispuesto por la superintendencia financiera y la DIAN.'),(2,5,'SITFIN','2','Cuentas y Documentos por Cobrar está conformado por letras y pagarés que se tienen con la empresa ACME, Las empresas extrangeras no han reportado los valores que nos adeudan y hay inconsistencias que se deben aclar puesto que si no se hace el valor que estamos reportando no es el correcto y debería ser revisado por el gerente en compañía del auditor general de estas zonas de comercio, tampoco se encuentran acrualizadas las vebnta s de comercio electrónico porque el intenet que se empleas no permite ver los privilegios de estas comunidades.'),(3,5,'SITFIN','3','No se incluyen las cuentas de ESSO de Colombia por que están a mas de 3 años y podrían no darse el pago.'),(4,5,'SITFIN','7','Los equipos de oficina se han valorizado de acuerdo a técnicas contables aceptadas y constituyen valors actuales en pesos constantes'),(5,5,'SITFIN','4','Cuentas y Documentos por Cobrar está conformado por letras y pagarés que se tienen con la empresa ACME, Las empresas extrangeras no han reportado los valores que nos adeudan y hay inconsistencias que se deben aclar puesto que si no se hace el valor que...'),(6,5,'SITFIN','5','Cuentas y Documentos por Cobrar está conformado por letras y pagarés que se tienen con la empresa ACME, Las empresas extrangeras no han reportado los valores que nos adeudan y hay inconsistencias que se deben aclar puesto que si no se hace el valor que...'),(7,5,'SITFIN','6','Cuentas y Documentos por Cobrar está conformado por letras y pagarés que se tienen con la empresa ACME, Las empresas extrangeras no han reportado los valores que nos adeudan y hay inconsistencias que se deben aclar puesto que si no se hace el valor que...'),(8,5,'SITFIN','8','Cuentas y Documentos por Cobrar está conformado por letras y pagarés que se tienen con la empresa ACME, Las empresas extranjeras no han reportado los valores que nos adeudan y hay inconsistencias que se deben aclarar puesto que si no se tiene el valor apropiado para esto');
